import React from "react";

class Weather extends React.Component {
    render() {
        return (
            <>
                <div>
                    <img src={"http://openweathermap.org/img/w/" + this.props.icon + ".png"} alt="weather icon"></img>
                    <h2>Location: { this.props.city }, { this.props.country }</h2>
                    <p>Current Weather Conditions: { this.props.desc }</p>
                    <h3>Current Temperature: { this.props.temp }</h3>
                    <h5>Current Humidity: { this.props.humidity }%</h5>
                </div>
            </>

        )
    }
};

export default Weather;
